MetaInfo.get_all_backword_transients_wit.Content:
impl MetaInfo {
    #[inline]
    #[inline]
    fn get_all_backword_transients_with_prefix<C>(
        &self,
        converter: C,
    ) -> Option<AHashMap<FastStr, FastStr>>
    where
        C: Converter,
    {
        match self.backward_node.as_ref() {
            Some(node) => {
                if let Some(t) = node.get_all_transients() {
                    let new_cap = t.len();
                    if new_cap == 0 {
                        return None;
                    }
                    let mut map = AHashMap::with_capacity(new_cap);
                    map.extend(
                        t.iter()
                            .map(|(k, v)| (converter.add_transient_prefix(k), v.clone())),
                    );
                    Some(map)
                } else {
                    None
                }
            }
            None => None,
        }
    }
}

MetaInfo.get_all_persistents_and_transie.Content:
