    fn iter_all_backword_transients_with_prefix<C>(
        &self,
        converter: C,
    ) -> impl Iterator<Item = (FastStr, &FastStr)>
    where
        C: Converter + 'static,
    {
        self.backward_node
            .as_ref()
            .into_iter()
            .flat_map(|node| {
                node.get_all_transients()
                    .into_iter()
                    .flat_map(|t| t.into_iter())
