pub trait Forward {
    fn get_persistent<K: AsRef<str>>(&self, key: K) -> Option<FastStr>;
    fn get_transient<K: AsRef<str>>(&self, key: K) -> Option<FastStr>;
    fn get_upstream<K: AsRef<str>>(&self, key: K) -> Option<FastStr>;

    fn get_all_persistents(&self) -> Option<&AHashMap<FastStr, FastStr>>;
    fn get_all_transients(&self) -> Option<&AHashMap<FastStr, FastStr>>;
    fn get_all_upstreams(&self) -> Option<&AHashMap<FastStr, FastStr>>;

    fn get_all_persistents_and_transients_with_rpc_prefix(
        &self,
    ) -> Option<AHashMap<FastStr, FastStr>>;
    fn get_all_persistents_and_transients_with_http_prefix(
        &self,
    ) -> Option<AHashMap<FastStr, FastStr>>;

    fn iter_persistents_and_transients_with_rpc_prefix(
        &self,
    ) -> impl Iterator<Item = (FastStr, &FastStr)>;
    fn iter_persistents_and_transients_with_http_prefix(
        &self,
    ) -> impl Iterator<Item = (FastStr, &FastStr)>;

    fn set_persistent<K: Into<FastStr>, V: Into<FastStr>>(&mut self, key: K, value: V);
    fn set_transient<K: Into<FastStr>, V: Into<FastStr>>(&mut self, key: K, value: V);
    fn set_upstream<K: Into<FastStr>, V: Into<FastStr>>(&mut self, key: K, value: V);

    fn strip_rpc_prefix_and_set_persistent<K: AsRef<str>, V: Into<FastStr>>(
        &mut self,
        key: K,
        value: V,
    );
    fn strip_rpc_prefix_and_set_upstream<K: AsRef<str>, V: Into<FastStr>>(
        &mut self,
        key: K,
        value: V,
    );

    fn strip_http_prefix_and_set_persistent<K: AsRef<str>, V: Into<FastStr>>(
        &mut self,
        key: K,
        value: V,
    );
    fn strip_http_prefix_and_set_upstream<K: AsRef<str>, V: Into<FastStr>>(
        &mut self,
        key: K,
        value: V,
    );

    fn del_persistent<K: AsRef<str>>(&mut self, key: K) -> Option<FastStr>;
    fn del_transient<K: AsRef<str>>(&mut self, key: K) -> Option<FastStr>;
    fn del_upstream<K: AsRef<str>>(&mut self, key: K) -> Option<FastStr>;
}

Node.clear.Content:
impl Node {
    set_impl!(persistent);
    set_impl!(transient);
    set_impl!(stale);

    del_impl!(persistent);
    del_impl!(transient);
    del_impl!(stale);

    get_impl!(persistent);
    get_impl!(transient);
    get_impl!(stale);

    get_all_impl!(persistent);
    get_all_impl!(transient);
    get_all_impl!(stale);

    #[inline]
    #[inline]
    pub fn clear(&mut self) {
        if let Some(v) = self.persistent.as_mut() {
            v.clear();
        }

        if let Some(v) = self.transient.as_mut() {
            v.clear();
        }

        if let Some(v) = self.stale.as_mut() {
            v.clear();
        }
    }
}

Node.extend.Content:
impl Node {
    set_impl!(persistent);
    set_impl!(transient);
    set_impl!(stale);

    del_impl!(persistent);
    del_impl!(transient);
    del_impl!(stale);

    get_impl!(persistent);
    get_impl!(transient);
    get_impl!(stale);

    get_all_impl!(persistent);
    get_all_impl!(transient);
    get_all_impl!(stale);

    #[inline]
    #[inline]
    pub fn extend(&mut self, other: Self) {
        if let Some(v) = other.persistent {
            if self.persistent.is_none() {
                self.persistent = Some(v);
            } else {
                self.persistent.as_mut().unwrap().extend(v);
            }
        }

        if let Some(v) = other.transient {
            if self.transient.is_none() {
                self.transient = Some(v);
            } else {
                self.transient.as_mut().unwrap().extend(v);
            }
        }

        if let Some(v) = other.stale {
            if self.stale.is_none() {
                self.stale = Some(v);
            } else {
                self.stale.as_mut().unwrap().extend(v);
            }
        }
    }
}

del_impl.Content:
macro_rules! del_impl {
    ($name:ident) => {
        paste! {
            #[inline]
            pub fn [<del_ $name>]<K: AsRef<str>>(&mut self, key: K) -> Option<FastStr> {
                let key = key.as_ref();
                if let Some(v) = self.$name.as_mut() {
                    v.remove(key)
                } else {
                    None
                }
            }
        }
    };
}

get_all_impl.Content:
macro_rules! get_all_impl {
    ($name:ident) => {
        paste! {
            #[inline]
            pub fn [<get_all_ $name s>](&self) -> Option<&AHashMap<FastStr, FastStr>> {
                self.$name.as_ref()
            }
        }
    };
}

get_impl.Content:
macro_rules! get_impl {
    ($name:ident) => {
        paste! {
            #[inline]
            pub fn [<get_ $name>]<K: AsRef<str>>(&self, key: K) -> Option<FastStr> {
                let key = key.as_ref();
                match self.$name.as_ref() {
                    Some(v) => {
                        v.get(key).cloned()
                    }
                    None => None,
                }
            }
        }
    };
}

set_impl.Content:
macro_rules! set_impl {
    ($name:ident) => {
        paste! {
            #[inline]
            pub fn [<set_ $name>]<K: Into<FastStr>, V: Into<FastStr>>(
                &mut self,
                key: K,
                value: V,
            ) {
                if self.$name.is_none() {
                    self.$name = Some(AHashMap::with_capacity(DEFAULT_CAPACITY));
                }
                self.$name.as_mut().unwrap().insert(key.into(), value.into());
            }
        }
    };
}

