Entry.and_modify.Content:
impl<'a, K, V> Entry<'a, K, V> {
    #[inline]
    #[inline]
    pub fn and_modify<F: FnOnce(&mut V)>(self, f: F) -> Self
    where
        V: Send + Sync + 'static,
    {
        Entry {
            inner: self.inner.and_modify(|v| {
                f(v.downcast_mut().unwrap());
            }),
            _marker: PhantomData,
        }
    }
}

